    function conclick (e)
    {
        c_s_data[0].current += 1;
        c_s_data[1](c_s_data.current);
        s_ss(2);

    }

    return (
        <C_data.Provider value={c_data}>
            <C_s_data.Provider value={c_s_data}>
            <Button onClick={conclick}>
